import WordEditor from "./WordEditor";
import {
  BrowserRouter as Router,
  Route,
  Routes,
  Navigate,
} from "react-router-dom";
// Switch > Routes
//Redirect > Navigate

function App() {
  <Router>
    <Routes>
      <Route
        path="/"
        element={<a href={`/documents/${uuidV4()}`}>create document</a>}
      />
      <Route path="/documents/:id" element={<TextEditor />} />
    </Routes>
  </Router>;
}

export default App;
